import React from 'react';
import './societyTable.css'
const SocietyTable = () => {
  const data = [
    { id: 1, name: 'John Doe', address: '123 Main St' },
    { id: 2, name: 'Jane Smith', address: '456 Elm St' },
    { id: 3, name: 'Alice Johnson', address: '789 Oak St' }
  ];

  return (
    <div className="table-container">
      <h1>Object Table View</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Address</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.address}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SocietyTable;
